import React from 'react'
import '../styles/Output.css'

const Output = props => {
    return(
        <div className='OutputWrapper'>
            { props.binaryOutput.map((bit, idx) => <span key={idx}>{bit}</span>)}
        </div>
    )
}

export default Output
